import React, { Component } from "react";
import { Link } from "react-router-dom";

export class Home extends Component {
  state = { isLoggedIn: false, loading: true, user: {}, items: [] };
  render() {
    return (
      <main className="home">
        <div className="home__callout">
          <span className="home__callout-text">WE HELP PIKUP YOUR GROCERY</span>
          <div className="home__action-container">
            <div className="home__id-container">
              <Link to="/login">
                <button className="home__login button-dark">GET PICKUP</button>
              </Link>
              <Link to="/browse">
                <button className="home__signup button-light">VOLUNTEER</button>
              </Link>
            </div>
          </div>
          <div className="home__explainer">
            <p className="home__text">Some kind of image can go here.</p>
          </div>
        </div>
      </main>
    );
  }
}

export default Home;
